import React, { useState } from 'react';

const Bk = () => {
    const[bg,setbg] = useState("cyan")
    const[prvbg,setprvbg] = useState('')
    const changebg=()=>{
        setprvbg(bg)
        setbg("black");
    }
    const undo=()=>{
        setbg(prvbg)
        
    }
    return (
        <div style={{background:bg, height:100%''}}>
            <h1 >Background Changer</h1>
            <button onClick={changebg} style={{alignContent:"center"}}>ChangeBackground</button>
            <button onClick={undo}>Undo</button>
        </div>
    );
};

export default Bk;
